Novos detalhes de Forza Motorsport foram revelados! 🏁

• O desenvolvimento do jogo foi pensado priorizando circuitos de corrida, então eventos de Drift e Drag não estarão disponíveis no lançamento, sendo algo a ser pensado posteriormente;

• A inteligência artificial dos oponentes foi totalmente melhorada e retrabalhada e utilizará machine learning, será muito semelhante a pilotos humanos (incluindo as falhas);

• A física dos pneus terá um salto muito grande comparado ao Forza Motorsport 7, tornando mais satisfatório a forma como o carro acelera, freia e faz curvas. Em vez de um único ponto de contato do pneu com a pista, agora serão 8;

O jogo chega no dia 10 de outubro para Xbox Series X|S, PC e Cloud Gaming, day-one no Xbox Game Pass!

